INSERT INTO `t_viste` VALUES (38,'ddd',1,'ddd','SELECT aziende.id, aziende.codice_fiscale, aziende.socio_principale, aziende.phone, aziende.note, territorio.nome\nFROM aziende\nINNER JOIN territorio ON aziende.territorio_id = territorio.id',1,0,0,'2025-01-08 16:49:26'),(43,'contaa',1,'aaa','SELECT COUNT(*) FROM aziende',1,0,0,'2025-01-08 23:08:07'),(44,'aziende',1,'aziende foligno','SELECT aziende.id, aziende.codice_fiscale, aziende.socio_principale, aziende.phone, aziende.note, territorio.nome\nFROM aziende\nINNER JOIN territorio ON aziende.territorio_id = territorio.id\nWHERE territorio.nome = \'foligno\'',1,0,0,'2025-01-08 23:08:30'),(46,'aziende citta di castello',1,'aziende citta','SELECT aziende.id, aziende.codice_fiscale, aziende.socio_principale, aziende.phone, aziende.note, territorio.nome\nFROM aziende\nINNER JOIN territorio ON aziende.territorio_id = territorio.id\nWHERE territorio.nome = \'Foligno\'',1,0,0,'2025-01-09 09:22:39'),(47,'ciao',1,'ciao','SELECT territorio.nome, COUNT(dipendenti.id) AS numero_dipendenti\nFROM territorio\nLEFT JOIN dipendenti ON territorio.id = dipendenti.territorio_id\nGROUP BY territorio.nome',1,0,0,'2025-01-09 09:33:37');
